INSERT OR IGNORE INTO disease_interactions (id, med_id, trade_name, disease_name, interaction_text, severity, reference_text, source, created_at) VALUES (12886, 52, 'Olanzapine', 'Hematologic Diseases', 'Cases of leukopenia, neutropenia, and agranulocytosis have been reported with the use of atypical antipsychotic agents.  Patients with preexisting low white blood cell count may be at increased risk.  Therapy with these agents should be administered cautiously in patients with a history of, or predisposition to, decreased white blood cell or neutrophil counts.  Clinical monitoring of hematopoietic function is recommended.  At the first sign of a clinically significant decline in white blood cells, discontinuation of atypical antipsychotic therapy should be considered in the absence of other causative factors, and the patient closely monitored for fever or other signs and symptoms of infection.', '2', '', 'DDInter', 0);
